    </div>
    <script>

        var thousandsFormat = d3.format(",d");
        var floatFormat = d3.format(".2")

        d3.csv("data/townpop-5yrchg.csv", function(data){
            data.forEach(function(d){
                d3.selectAll("path." + d.slug)
                    .datum(d)
            })

            d3.select("svg#birthrate")
                .selectAll("path")
                .style("fill",function(d){
                    if (d){
                        var value = d.birthrate;
                        if (value == ""){
                            return "#ccc"
                        } else if (value < 0.5) {
                            return "#deebf7"
                        } else if (value < 1.0) {
                            return "#9ecae1"
                        } else if (value < 1.5) {
                            return "#3182bd"
                        } else {
                            return "#ccc"
                        }
                    } else {
                        return "#ccc"
                    }

                })

            d3.select("svg#deathrate")
                .selectAll("path")
                .style("fill", function(d){
                    if (d){
                        var value = d.deathrate;
                        if (value == ""){
                            return "#ccc"
                        }else if (value < 0.5) {
                            return "#fee5d9"
                        } else if (value < 1.0) {
                            return "#fcae91"
                        } else if (value < 1.5) {
                            return "#fb6a4a"
                        } else if (value < 2) {
                            return "#de2d26"
                        } else if (value < 10) {
                            return "#a50f15"
                        } else {
                            return "#ccc"
                        }
                    } else {
                        return "#ccc"
                    }
                })
        })

        d3.selectAll(".chart")
            .selectAll("path")
            // .style("background-color", "black")
            .on("mouseover",function(d){
                var town = this.className.baseVal
                
                d3.selectAll("path")
                    .style("opacity",.3)

                d3.selectAll("path." + town)
                    .style("opacity",1)
                    .attr("stroke","#494949")

                d3.select("div#sidebar")
                    .html(function(){
                        if (d.birthrate === ''){
                            return "<h3>" + d.Town_proper + "</h3><br>"+
                                    "<i>No data is available for this town</i>"
                        } else {
                            return "<h3>"+ d.Town_proper +"</h3><hr>" +
                                "<h4>2016 stats</h4>" +
                                "<b>Population</b>: " + thousandsFormat(d.pop2016) + "<br>" +
                                "<b>Births</b>: " + d.births2016 + "<br>" +
                                "<b>Deaths</b>: " + d.deaths2016 + "<br><hr>" +
                                "There were " +
                                floatFormat(d.birthrate) + " births and " +
                                floatFormat(d.deathrate) + " deaths per 100 " + d.Town_proper + 
                                " residents each year between 2012 and 2016."
                                
                        }
                    });
                
                showMobile("div#sidebar")
                hideMobile(".legend")
                
            })
            .on("mouseout", function(){
                d3.selectAll("path")
                    .style("opacity",1)
                    .attr("stroke","#ccc")

                d3.select("div.sidebar")
                    .html("<i>Hover or tap a town for more information</i>")

                hideMobile("div#sidebar")
                showMobile(".legend")

            })
        
        jQuery(".toggle-btn").click(function(){
            if (!$(this).hasClass("btn-selected") ) {
                $(this).addClass("btn-selected");
                if ($(this).hasClass("births-btn")){
                    
                    toggleElements("#birthrate-container", "#deathrate-container");
                    $("button.deaths-btn").removeClass("btn-selected");

                } else {

                    toggleElements("#deathrate-container", "#birthrate-container");
                    $("button.births-btn").removeClass("btn-selected");

                }
            }
        });


        function showMobile(item) {
            d3.select(item)
                .classed("showMobile",true)
                .classed("hideMobile",false)
        }

        function hideMobile(item){
            d3.select(item)
                .classed("hideMobile",true)
                .classed("showMobile",false)
        }

        function toggleElements(show, hide){
            $(show).addClass("selected");
            $(hide).removeClass("selected");
        }

        // $("#sidebar").stickybits({useStickyClasses: true,verticalPosition: 'bottom'});
            
        var pymChild = new pym.Child();
    </script>
</body>
</html>
